import React, { Component } from 'react';
import './styles.css'

class Client extends Component {
    render() {
        return(
            <div className="container-forms"> 
                <h1 className="text-forms" className="">Registrate para continuar</h1> 
                <form className="form-users">                                       
                    <input className="field" id="name" type="text" placeholder="Nombre"/>
                    <input className="field" id="last-name" type="text" placeholder="Apellido"/>
                    <input className="field" id="email" type="email" placeholder="Correo electrónico"/>
                    <input className="field" id="cellphone" type="text" placeholder="Celular"/>
                    <input className="field" id="address" type="text" placeholder="Dirección"/>
                    <input type="submit" value="Enviar"/>
                </form>                    
            </div> 
        );
    }
}

export default Client;
